// import { Link } from 'react-router-dom';
import * as rb from "react-bootstrap";

// const colStyle = {
//     margin: "3em",
//     diplay: "flex",
// }

class Sem4 extends React.Component {
    render() { 
        return (
            <rb.Container>
                <rb.Row>
                    <rb.Col>
                        DBMS
                    </rb.Col>
                    <rb.Col>
                        JAVA
                    </rb.Col>
                    <rb.Col>
                        DAA
                    </rb.Col>
                </rb.Row>
                <rb.Row>
                    <rb.Col>
                        OS
                    </rb.Col>
                    <rb.Col>
                        MATH4
                    </rb.Col>
                </rb.Row>
            </rb.Container>
        );
    }
}

export default Sem4;
